(window.webpackJsonp=window.webpackJsonp||[]).push([[15],{527:function(v,_,t){"use strict";t.r(_);var a=t(6),r=Object(a.a)({},(function(){var v=this,_=v.$createElement,t=v._self._c||_;return t("ContentSlotsDistributor",{attrs:{"slot-key":v.$parent.slotKey}},[t("h2",{attrs:{id:"记一次面试经历"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#记一次面试经历"}},[v._v("#")]),v._v(" 记一次面试经历")]),v._v(" "),t("hr"),v._v(" "),t("h5",{attrs:{id:"写在前面的话"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#写在前面的话"}},[v._v("#")]),v._v(" 写在前面的话")]),v._v(" "),t("p",[v._v("写这个文章的时候其实已经是4月25日，即一周后了，中间这段时间也不知道在忙什么，学习也没学到什么，blog也没再更新过。想一想，这一次面试是周四，后一天应该是要打疫苗了，打完疫苗也不知道是心理原因还是什么，一直感觉很困。今天终于早起了一次（7.20起床），抽点时间把博客更新一下吧。")]),v._v(" "),t("hr"),v._v(" "),t("p",[v._v("这次的面试是上海农商银行的面试，这个也是当初病急乱投医胡乱投的简历中的一个。其实讲道理，上海农商银行的这个面试其实还挺复杂的。首先要笔试，这个笔试其实也挺难的（可能是我太菜了），我感觉我都没做对几道题，就通过了，其实现在想想可能是报名人数太少了，笔试成绩其实就没看。笔试通过后还有一面，是AI面试，要求视频回答问题，这个问题其实也挺离谱的，全是问的相关什么遇到困难的事是什么之类的布拉不拉，我基本上全都回答的fpga哈哈哈哈，其实遇到的困难还是很多的，但是fpga这个事特别让我恶心，特别记忆犹新。这个一面感觉也好水，我每个问题回答时间平均四分多钟通过了，舍友平均30多秒也通过了，他真的会看这个东西吗。")]),v._v(" "),t("p",[v._v("好了言归正传，这次主要是记录面试经历的，毕竟也是，准备踏入社会的第一次找工作面试，总要纪念一下的。")]),v._v(" "),t("p",[v._v("上海农商银行这个居然还是现场面试，就很狗，十点开始面试，早上六点就得起。六点半登上班车，七点半到四平，然后十号线转二号线转九号线再转公交911路，其实本来是十号线转四号线的，但是一不留神坐过了，体验了一波早高峰的二号线。其实还是遇到很多波折的，到了园区门口发现忘带身份证了，门卫还不让进，一度以为进不去了，幸好HR小姐姐真的非常善良，跑到门口来接我，把她身份证押给我，这才顺利进园区，真的非常感谢小姐姐！")]),v._v(" "),t("p",[v._v("正式开始面试了，是二对三的那种，两个面试官对三个人，我这一组除了我剩下那两个都是东华的研究生，其实听到这个还是有点紧张的，只有我一个本科生。候场的时候还听说下一组有个人是北邮的，为了面试专程从北京跑过来，真的感觉，大可不必，哈哈哈哈。面试官挺和蔼的，问的问题也蛮水的，都没有问专业技术上的问题，全是问一些，这里记录一下把哈哈哈哈。")]),v._v(" "),t("ul",[t("li",[v._v("自我介绍")]),v._v(" "),t("li",[v._v("平时有用到啥语言")]),v._v(" "),t("li",[v._v("希望在这里实习能学到什么")]),v._v(" "),t("li",[v._v("有没有秋招的打算")])]),v._v(" "),t("p",[v._v("就这些，面试官还问我，有没有考研打算，我说没有，他们好像不太信的样子哈哈哈哈。面试官好像有一个还是同济的，他对同济十分了解，我说什么都能接上话哈哈哈哈，还一直冲着我笑。不过面试官说，本次实习的目的主要是为了秋招，所以听他意思，我这种本科生明摆着秋招不会去，可能被录用的概率不高，而且，他这个实习是三个月时间，感觉也有些长了。不过工资确实蛮高，一天二百真不错。")]),v._v(" "),t("p",[v._v("总结一下把。这次面试总的来说还是挺愉快的，虽然略有波折，但总体来说还是比较顺利的。获得了不少面试经验，面试官很和蔼，没有故意刁难，也认识了有趣的人，就同组的那两个学长学姐，感觉他们的人还是比较好的，那个学姐听说我没吃早饭，还送给我她早上买的面包，最好没能加上微信这是疏忽之处。遇到了很多善良的人，比如那个HR小姐姐。")]),v._v(" "),t("p",[v._v("再升华一下好了，哈哈哈哈。反正就是通过这个经历，也感觉到了必须要走出自己的舒适圈。我之前（包括现在也是这样）交际圈很小，避免甚至排斥和外人陌生人认识交流，很长一段时间里，都是活在自己的世界，上大学三年了，到现在还没有真正玩得来的朋友，交情还是有的，但是不是那种特别要好的那种，做很多事还是自己一个人。三年了，异性也没有认识到，女朋友就自然不要多说了哈哈。总是活在自己圈子里，那我的生活中自然还是只有自己了，要尝试走出舒适圈，这样才能认识更多的人，才能结交到很好的朋友。")]),v._v(" "),t("p",[v._v("哈哈哈哈哈其实虽然这样写，我以后也是大概率不会改的，本质上还是个社恐罢了，比如这次面试或是其他类似的经历也大多是被迫这么做了。")]),v._v(" "),t("p",[v._v("其实想想，当初真该去参加社团或者学生会，而不是当这个什么劳什子班长，唉，命运自有安排，有缘再见好了。")])])}),[],!1,null,null,null);_.default=r.exports}}]);